import React, { useState } from 'react'

const DrawerItems = [
    {
        id: 1,
        label: 'Are you a Veterinarian?',
        path: '/vet',
    },
    {
        id: 2,
        label: 'Login',
        path: '/login',
    }
]

const MobileDrawer = () => {
    const [isDrawerOpen, setIsDrawerOpen] = useState(false)

    return (
        <div>
            Mobile Drawer
        </div>
    )
}

export default MobileDrawer
